import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterOutlet } from '@angular/router';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [CommonModule, RouterOutlet],
  template: `
    <div class="app-wrapper">
      <!-- Navbar -->
      <nav class="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
        <div class="container">
          <a class="navbar-brand" href="#" (click)="scrollToSection('hero')">
            <img src="assets/logo.png" alt="Pravda Saga Logo" height="40">
            Pravda Saga Abogados & Académicos
          </a>
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarNav">
            <ul class="navbar-nav ms-auto">
              <li class="nav-item">
                <a class="nav-link" href="#" (click)="scrollToSection('hero')">
                  <i class="fas fa-home me-1"></i>Inicio
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#" (click)="scrollToSection('about')">
                  <i class="fas fa-users me-1"></i>Nosotros
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#" (click)="scrollToSection('services')">
                  <i class="fas fa-briefcase me-1"></i>Servicios
                </a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#" (click)="scrollToSection('blog')">Blog</a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#" (click)="scrollToSection('sentencias')">Sentencias</a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#" (click)="scrollToSection('mi-cartera')">Mi Cartera</a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#" (click)="scrollToSection('contact')">
                  <i class="fas fa-phone me-1"></i>Contacto
                </a>
              </li>
              <li class="nav-item d-none d-lg-block">
                <a href="tel:+5712345678" class="nav-link">
                  <i class="fas fa-phone me-1"></i>Llamar
                </a>
              </li>
              <li class="nav-item d-none d-lg-block">
                <a href="https://wa.me/5712345678" class="nav-link" target="_blank">
                  <i class="fab fa-whatsapp me-1"></i>WhatsApp
                </a>
              </li>
            </ul>
          </div>
        </div>
      </nav>

      <!-- Main Content -->
      <main class="main-content">
        <router-outlet></router-outlet>
      </main>

      <!-- Footer -->
      <footer class="footer bg-dark text-white py-4">
        <div class="container">
          <div class="row">
            <div class="col-12 text-center">
              <p class="mb-0">&copy; 2024 Pravda Saga Abogados & Académicos. Todos los derechos reservados. Licencia Profesional No. 12345 - Consejo Superior de la Judicatura</p>
            </div>
          </div>
          <div class="row mt-2">
            <div class="col-12 text-center">
              <p class="mb-0">Horario de Atención: Lun - Vie: 8:00 AM - 6:00 PM</p>
            </div>
          </div>
        </div>
      </footer>
    </div>
  `,
  styles: [`
    .app-wrapper {
      display: flex;
      flex-direction: column;
      min-height: 100vh;
    }

    .navbar {
      box-shadow: 0 2px 4px rgba(0,0,0,.1);
      z-index: 1000;
    }
    
    .navbar-brand img {
      margin-right: 10px;
    }
    
    .nav-link {
      font-weight: 500;
      transition: color 0.3s ease;
    }
    
    .nav-link:hover {
      color: #fbbf24 !important;
    }
    
    .main-content {
      flex: 1;
      padding-top: 76px;
    }

    .footer {
      margin-top: auto;
    }
  `]
})
export class AppComponent {
  title = 'Pravda Saga - Sistema de Gestión Legal';

  scrollToSection(sectionId: string): void {
    const element = document.getElementById(sectionId);
    if (element) {
      element.scrollIntoView({ 
        behavior: 'smooth',
        block: 'start'
      });
    }
  }
}
